import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Board extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            jsonReturn: this.getJson()
        }
    }

    getJson() {
        return 'hello';
    }

    render() {
        return (
            <div className="app-container">
                {this.state.jsonReturn}
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <Board />,
    document.getElementById('root')
);
